import React from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";
import Card from "pnnl-react-core/lib/Card";
import Grid from "react-bootstrap/es/Grid";
import ResultsTable from "./ResultsTable";

class Report extends React.Component {
  render() {
    return (
      <Grid>
        <h1>Report Page</h1>
        <br />
        {!(this.props.location.state == null) ? (
          <div class="inline">
            <ResultsTable data={this.props.location.state.data} />
            </div>
        ) : (
          <Card>
          <h2>No data Calculated</h2>
          <ol>
            <li>
              Click on Calculator above
            </li>
            <li>
              Choose which way to calculate data
            </li>
            <li>
              Click Calculate and you will be redirected here
            </li>
          </ol>
          </Card>
        )}
        {!(this.props.location.state == null) ? (
          <div class = "reportImage">
            <img src = "http://localhost:8000/tm30_output.png" />
          </div>
        ) : (
          <div>
          </div>
        )}
      </Grid>
    );
  }
}

export default Report;
